def main(array):
    counterPartidos = len(array)
    counterEmpates = 0
    if counterPartidos == 0:
        return [-1, -1]
    for i in range(0, len(array)):
        if array[i]['winner'] == 'D':
            counterEmpates += 1
    umbral = counterEmpates/counterPartidos
    TP = 0
    TN = 0
    FP = 0
    FN = 0
    for  i in range(0, len(array)):
        if array[i]['probabilidad_total_empate'] > umbral:
            if array[i]['winner'] == 'D':
                TP += 1
            if array[i]['winner'] != 'D':
                FP += 1
        if array[i]['probabilidad_total_empate'] < umbral:
            if array[i]['winner'] == 'D':
                FN += 1
            if array[i]['winner'] != 'D':
                TN += 1
    if TN + FN == 0 and TP+FP == 0:
        WAP = 0
    elif TN + FN == 0 and TP+FP != 0:
        WAP = (1-umbral)*(TP/(TP+FP))
    elif TN + FN != 0 and TP+FP == 0:
        WAP = umbral*(TN/(TN+FN))
    else:
        WAP = umbral*(TN/(TN+FN))+(1-umbral)*(TP/(TP+FP))

    if TP+FN == 0 and TN+FP == 0:
        WAR = 0
    elif TP+FN == 0 and TN+FP != 0:
        WAR = (1-umbral)*(TN/(TN+FP))
    elif TP+FN != 0 and TN+FP == 0:
        WAR = umbral*(TP/(TP+FN))
    else:
        WAR = umbral*(TP/(TP+FN))+(1-umbral)*(TN/(TN+FP))

    return [WAP, WAR]



